                var html_4dd78dcd578ee8a1751b2a1ed42c1216 = $(`<div id="html_4dd78dcd578ee8a1751b2a1ed42c1216" style="width: 100.0%; height: 100.0%;"><b>FROM WASTE TO WEALTH: KITCHEN WASTE COMPOSTING WORKSHOP</b><br>Venue: City Plaza Park<br>Date and Time: 2024-03-01T15:10:48.000Z 12:00<br>What is it about?: Join us for an interactive workshop on converting kitchen waste into nutrient-rich compost for your garden. Learn how to turn banana peels, vegetable scraps, and other organic waste into valuable compost that enriches the soil and promotes plant growth. Our expert instructors will guide you through the composting process, from setting up a compost bin to maintaining the right balance of materials. By attending this workshop, you'll not only reduce your environmental footprint by diverting waste from landfills but also create a sustainable source of nourishment for your plants. Don't miss this opportunity to transform your kitchen waste into a valuable resource for your garden!</div>`)[0];
